function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Welcome to Brandons's Blog. Please login and to speak your mind!
        </p>
        <Button onClick={'google.com'} variant="dark">Get to Blogging</Button>

      </header>
    </div>
  );
}

export default App;
